import Link from 'next/link';

const Login = () => (
    <div>
        <ul>
            <li><Link href="/"><a>Home</a></Link></li>
            <li><Link href="/login"><a>Login</a></Link></li>
        </ul>
        <h1>Login</h1>
        <p>To enter, please, login</p>
    </div>
);

export default Login;
